function User({ name, surname, isLoggedIn, age, friends }) {
  return (
    <>
      <h1>{isLoggedIn ? `${name} ${surname} (${age})` : "Giris yapmadiniz"}</h1>

      {friends.map((friend) => (
        <div key={friend.id}>
          {friend.id}. {friend.name}
        </div>
      ))}
    </>
  );
}

export default User;
